def generate_strongly_connected_graph(n: int, m: int) -> (int, list):
    """"""
    import math
    dim = math.ceil(math.log(n) / math.log(m))
    if n < 4:
        dim = 1
    if n < 6:
        dim = 2
    if n == 5:
        adjacency_list = [[1, 4], [2, 0], [3, 1], [4, 2], [0, 3]]
    else:
        adjacency_list = [[(i * m + c) % n for c in range(m)] for i in range(n)]
    return (dim, adjacency_list)
